Now we should have an auto-generated ID for our child nodes 

### The code for it is:

```
    // Get the last Id of a given node and adds increment to it
    private string GenerateId(string parentNode, int increment = 1)
    {
        var data =
            wikiRoot.Root.Elements(parentNode)
            .Elements()
            .Last()
            .Attribute("Id").Value;

        int newId = -999;
        var newdata = Int32.TryParse(data, out newId);

        if (!newdata)
        {
            throw new ArgumentException(data + " is not a numeric string");
        }

        newId += increment;

        return newId.ToString();
    }
```

